import React from "react";
import {Link} from "react-scroll";

class Navbar  {
state = {};
render(){
  return(
<div className="Navbar">

<Link
    activeClass="active"
    to="Home"
    spy={true}
    smooth={true}
    offset={-70}
    duration= {500}
>home</Link>

<Link
    activeClass="active"
    to="About"
    spy={true}
    smooth={true}
    offset={-70}
    duration= {500}
>about</Link>

<Link
    activeClass="active"
    to="Service"
    spy={true}
    smooth={true}
    offset={-70}
    duration= {500}
>service</Link>

<Link
    activeClass="active"
    to="Contact"
    spy={true}
    smooth={true}
    offset={-70}
    duration= {500}
>contact</Link>


</div>
);
}
}
export default Navbar;
